// import './App.css';
import { Route, Router } from 'react-router';
import { CreatePost } from './components/index.js'
import { Home, Login, Signup } from './pages'

function App() {
  return (
    <div className="wrapper">
      <Router>
        <Route pathname='/' element={<Home />} />
        <Route pathname='/login' element={<Login />} />
        <Route pathname='/signup' element={<Signup />} />
        <Route pathname='/create' element={<CreatePost />} />
      </Router>
    </div>
  );
}

export default App;
